                                "symptoms": "<p>The Red Blood Cell Count test can be done:</p>\n<ul>\n<li>\n<p>As part of routine health checkups to monitor your overall health.</p>\n</li>\n<li>\n<p>As part of a complete blood count test.</p>\n</li>\n<li>\n<p>If you have symptoms suggestive of anemia or low RBC count, such as weakness, fatigue, pale skin, etc.</p>\n</li>\n<li>\n<p>If you have symptoms suggestive of high RBC count, such as headache, dizziness, vision problems, etc.&nbsp;</p>\n</li>\n<li>\n<p>If you have a condition or are taking medication that may affect your RBC count.</p>\n</li>\n<li>\n<p>When you are receiving treatments that can affect your blood cell count, such as chemotherapy.</p>\n</li>\n</ul>",
