                                "composition_details": [
                                    {
                                        "name": "Cholesterol - Total",
                                        "composition_details": [],
                                        "understand": "<p>The Cholesterol - Total test measures the total amount of cholesterol (fats) in your blood. Cholesterol is mainly synthesized in the liver and partially in the intestines. It acts as a building block for cell membranes, is a precursor to vital hormones, and helps produce bile acids that help digest fats. Cholesterol is transported through the blood as lipoproteins: low-density lipoprotein (LDL) and high-density lipoprotein (HDL). An optimal amount of these proteins is necessary for proper body functioning.</p>",
                                        "id": 2178,
                                        "slug_url": "/labs/test/cholesterol-total-2178"
                                    },
                                    {
                                        "name": "Urine R/M (Urine Routine & Microscopy)",
                                        "composition_details": [
                                            {
                                                "name": "Urobilinogen",
                                                "composition_details": [],
                                                "understand": "<p>The Urobilinogen test measures the amount of urobilinogen present in the urine. Urobilinogen is a substance formed from the breakdown of bilirubin, a by-product of old red blood cells processed by the liver. This test plays a key role in assessing liver function and detecting liver diseases.</p>\n<p>Under normal circumstances, the liver converts bilirubin into urobilinogen. Some of this urobilinogen is reabsorbed into the blood, excreted by the kidneys, and then eliminated from the body through urine. However, when liver function is impaired, the amount of urobilinogen in the urine can change. Hence, the Urobilinogen test serves as an important indicator of abnormalities such as liver disease or blockage of the bile ducts.</p>",
                                                "id": 2622,
                                                "slug_url": "/labs/test/urobilinogen-2622"
                                            },
                                            {
                                                "name": "Ketone",
                                                "composition_details": [],
                                                "understand": "<p>The Ketone test measures the presence of ketone bodies in the urine, which are metabolic byproducts produced when the body breaks down fat for energy in the absence of sufficient carbohydrates. This process, known as ketosis, typically occurs during states such as prolonged fasting, strict low-carbohydrate diets, or in certain medical conditions like uncontrolled diabetes mellitus, particularly type 1 diabetes. In diabetes, for instance, the test can help identify diabetic ketoacidosis (DKA), a serious complication characterized by high levels of ketones that can lead to an acid-base imbalance in the blood. The presence of ketones in the urine can be an important marker for monitoring metabolic states and managing conditions that affect blood sugar levels.</p>",
                                                "id": 2623,
                                                "slug_url": "/labs/test/ketone-2623"
                                            },
                                            {
                                                "name": "Nitrite",
                                                "composition_details": [],
                                                "understand": "<p>The Nitrite test measures the presence of nitrites in the urine sample. Nitrites are chemicals formed by the conversion of nitrates by certain bacteria. Under normal conditions, urine does not contain nitrites. However, when bacteria that cause urinary tract infections (UTIs) are present, they convert nitrates (which are normally found in the urine) into nitrites. Thus, the presence of nitrites in urine is an indication of a bacterial infection, making the Nitrite test a key tool in diagnosing UTIs.</p>",
                                                "id": 2626,
                                                "slug_url": "/labs/test/nitrite-2626"
                                            },
                                            {
                                                "name": "Colour",
                                                "composition_details": [],
                                                "understand": "<p>The urine colour test primarily measures the concentration and colour of urine to provide insights into an individual&rsquo;s&nbsp; overall health. It assesses hydration status, with clear to light yellow urine indicating good hydration and darker shades suggesting dehydration. It can also detect urinary tract infections (UTIs) through unusual colours like cloudy or reddish urine, signaling the presence of blood or pus. Abnormal urine colours, such as dark brown or amber, may indicate liver conditions like hepatitis or cirrhosis, while pink, red, or brown urine can reveal the presence of blood, signaling kidney issues, trauma, or potential malignancies. The test can reflect dietary influences and supplement intake, with certain foods and vitamins causing colour changes. It can also highlight metabolic disorders, such as porphyria, which may cause purple urine. Additionally, medication effects and potential exposure to toxins can be inferred from changes in urine colour, making this test a comprehensive indicator of overall health and potential underlying conditions.</p>",
                                                "id": 2628,
                                                "slug_url": "/labs/test/colour-2628"
                                            },
                                            {
                                                "name": "Appearance",
                                                "composition_details": [],
                                                "understand": "<p>The urine appearance test measures:</p>\n<p>Colour: The urine colour indicates the presence of substances like bilirubin, blood, or medications in the urine, providing clues about liver function, hydration levels, or underlying health issues.</p>\n<p>Clarity: The urine clarity assesses the transparency of urine, which can reveal the presence of cells, proteins, or other particles that may indicate infections or kidney disease.</p>\n<p>Odor: The urine odor detects abnormal smells that may indicate infections or metabolic disorders affecting the urinary system.</p>\n<p>By examining these aspects, doctors can gain insights into hydration status, kidney function, and potential health conditions affecting the urinary tract. This comprehensive evaluation aids in timely diagnosis and management of potential urinary tract problems.&nbsp;</p>",
                                                "id": 2629,
                                                "slug_url": "/labs/test/appearance-2629"
                                            },
                                            {
                                                "name": "Specific Gravity",
                                                "composition_details": [],
                                                "understand": "<p>The urine Specific Gravity test measures the concentration of solutes in the urine, reflecting the kidneys' ability to concentrate or dilute the urine in response to varying hydration levels. By comparing the density of urine to that of water, the test provides insights into the balance of fluids and substances like salts, waste products, and other solutes. This test is important because it helps diagnose and monitor various medical conditions, including dehydration, kidney disease, diabetes insipidus, and other disorders affecting kidney function, enabling timely and appropriate medical interventions.</p>",
                                                "id": 2630,
                                                "slug_url": "/labs/test/specific-gravity-2630"
                                            },
                                            {
                                                "name": "Epithelial Cell",
                                                "composition_details": [],
                                                "understand": "<p>The Epithelial Cell test measures the presence and quantity of epithelial cells shed into the urine. This test helps doctors understand urinary tract health by identifying abnormalities such as infections, inflammation, or damage to kidney tubules. Different types of epithelial cells in urine, including squamous, transitional, and renal tubular epithelial cells, provide specific insights into the nature and location of urinary tract issues. This test aids in diagnosing conditions affecting the urinary system and guides appropriate treatment strategies based on the findings.</p>",
                                                "id": 2633,
                                                "slug_url": "/labs/test/epithelial-cell-2633"
                                            },
                                            {
                                                "name": "Casts",
                                                "composition_details": [],
                                                "understand": "<p>The urinary cast test measures the presence, and quantity of casts in a urine sample. These casts are cylindrical structures formed from coagulated proteins and cells within the kidney's tubules. By identifying and quantifying the different types of casts, such as red blood cell casts, white blood cell casts, granular casts, and hyaline casts, the test provides valuable insights into kidney health. The presence of specific types of casts can indicate underlying kidney conditions, such as glomerulonephritis, kidney infections, acute tubular necrosis, and chronic kidney disease. This test helps doctors diagnose, monitor, and manage kidney-related issues, guiding appropriate medical interventions and treatments.</p>",
                                                "id": 2634,
                                                "slug_url": "/labs/test/casts-2634"
                                            },
                                            {
                                                "name": "Crystals",
                                                "composition_details": [],
                                                "understand": "<p>The Crystals test measures the presence, type, and quantity of crystals in a urine sample. Crystals can form from various salts and minerals in the urine, and their identification helps diagnose underlying conditions such as kidney stones, urinary tract infections, or metabolic disorders. The test provides insights into potential urinary tract issues by detecting specific types of crystals, such as calcium oxalate, uric acid, or struvite crystals. By analyzing the crystals, doctors can determine the severity of the condition, monitor the effectiveness of treatment, and guide preventive measures to maintain optimal urinary tract health.</p>",
                                                "id": 2635,
                                                "slug_url": "/labs/test/crystals-2635"
                                            },
                                            {
                                                "name": "Protein Urine",
                                                "composition_details": [],
                                                "understand": "<p>The Protein Urine test detects the presence of proteins in the urine sample. Essential proteins are typically retained in the blood by healthy kidneys, but their presence in urine can indicate kidney damage or dysfunction. Conditions like diabetes, hypertension, and certain kidney diseases can cause increased protein leakage into the urine. This test is crucial for assessing kidney health and detecting abnormalities that may require further investigation or intervention.</p>",
                                                "id": 2644,
                                                "slug_url": "/labs/test/protein-urine-2644"
                                            },
                                            {
                                                "name": "Ph for Urine",
                                                "composition_details": [],
                                                "understand": "<p>The Ph for Urine primarily measures the acidity or alkalinity of urine by assessing the balance of hydrogen ions in the urine. It provides insights into an individual&rsquo;s metabolic and kidney function, with acidic urine suggesting conditions like metabolic or respiratory acidosis, and alkaline urine indicating potential metabolic or respiratory alkalosis. The test can also reflect dietary influences, such as high protein diets may lead to acidic urine, while fruit-rich diets may result in alkaline urine. Abnormal pH levels can indicate conditions such as urinary tract infections, kidney stones, and certain metabolic disorders. Additionally, the test helps to monitor the impact of medications and supplements on urine pH, making it a valuable tool for comprehensive health assessment and diagnosis.</p>",
                                                "id": 33157,
                                                "slug_url": "/labs/test/ph-for-urine-33157"
                                            },
                                            {
                                                "name": "Urine Glucose",
                                                "composition_details": [],
                                                "understand": "<p>The Urine Glucose test measures the presence or absence of glucose in the urine sample. Normally, glucose is filtered out by the kidneys and reabsorbed into the blood, so it should not be detectable in the urine. When glucose appears in the urine, it indicates that blood glucose levels may be elevated beyond the kidneys' reabsorption capacity.&nbsp;</p>\n<p>Urine glucose is a useful test to check how well your body is managing glucose levels and kidney function. It helps diagnose and monitor diabetes, provides insight into blood sugar control, and can indicate potential issues with kidney function.</p>",
                                                "id": 34976,
                                                "slug_url": "/labs/test/urine-glucose-34976"
                                            }
                                        ],
                                        "understand": "<p>The Urine R/M (Urine Routine & Microscopy) test involves gross, chemical, and microscopic evaluation of the urine sample.</p>\n<ol>\n<li>\n<p>Gross examination: It involves visually inspecting the urine sample for color and appearance. Typically, the urine color ranges from colorless or pale yellow to deep amber, depending on the urine&rsquo;s concentration. Things such as medications, supplements, and some foods such as beetroot can affect the color of your urine. However, unusual urine color can also be a sign of disease.</p>\n<p>In appearance, the urine sample may be clear or cloudy. A clear appearance is indicative of healthy urine. However, the presence of red blood cells, white blood cells, bacteria, etc., may result in cloudy urine, indicating conditions such as dehydration, UTIs, kidney stones, etc. Some other factors, such as sperm and skin cells, may also result in a cloudy appearance but are harmless.</p>\n</li>\n<li>\n<p>Chemical examination: It examines the chemical nature of the urine sample using special test strips called dipsticks. These test strips are dipped into the urine sample and change color when they come in contact with specific substances. The degree of color change estimates the amount of the substance present. Some common things detected include protein, urine pH, ketones, glucose, specific gravity, blood, bilirubin, nitrites, and urobilinogen.</p>\n</li>\n<li>\n<p>Microscopic examination: This involves the analysis of the urine sample under the microscope for pus cells, red blood cells, casts, crystals, bacteria, yeast and other constituents.</p>\n</li>\n</ol>",
                                        "id": 2374,
                                        "slug_url": "/labs/test/urine-r-m-urine-routine-microscopy-2374"
                                    },
                                    {
                                        "name": "CBC (Complete Blood Count)",
                                        "composition_details": [
                                            {
                                                "name": "Absolute Lymphocyte Count",
                                                "composition_details": [],
                                                "understand": "<p>An Absolute Lymphocyte Count test measures the total number of lymphocytes in the blood. Lymphocytes are a type of white blood cells that play an important role in your immune system and help your body fight disease and infection. There are two main types of lymphocytes:</p>\n<ul>\n<li>\n<p>T lymphocytes (T cells): T cells control your body&rsquo;s immune system response and directly attack and kill infected cells and tumor cells.</p>\n</li>\n<li>\n<p>B lymphocytes (B cells): B cells make antibodies. Antibodies are proteins that target viruses, bacteria, and other foreign pathogens.</p>\n</li>\n</ul>\n<p>Lymphocytes help your immune system remember every antigen (a foreign substance) it comes in contact with. After an encounter, some lymphocytes turn into memory cells. When these memory cells run into an antigen again, they recognize it and quickly respond. It is also the reason why getting vaccinated helps prevent certain diseases.</p>",
                                                "id": 1298,
                                                "slug_url": "/labs/test/absolute-lymphocyte-count-1298"
                                            },
                                            {
                                                "name": "Absolute Neutrophil Count",
                                                "composition_details": [],
                                                "understand": "<p>An Absolute Neutrophil Count test measures the percentage of neutrophils per microliter of blood. Neutrophils are a type of WBC and play an integral part in the body's immune system. They help fight off bacterial infections in the body by identifying and destroying foreign invaders, such as disease-causing microorganisms.&nbsp;</p>",
                                                "id": 1496,
                                                "slug_url": "/labs/test/absolute-neutrophil-count-1496"
                                            },
                                            {
                                                "name": "Differential Leukocyte Count",
                                                "composition_details": [
                                                    {
                                                        "name": "Differential Neutrophil Count"
                                                    },
                                                    {
                                                        "name": "Differential Lymphocyte Count"
                                                    },
                                                    {
                                                        "name": "Differential Monocyte Count"
                                                    },
                                                    {
                                                        "name": "Differential Eosinophil Count"
                                                    },
                                                    {
                                                        "name": "Differential Basophil Count"
                                                    }
                                                ],
                                                "understand": "<p>There are five types of WBCs: neutrophils, lymphocytes, monocytes, eosinophils, and basophils. A Differential Leukocyte Count test measures the percentage of each type of WBC in the blood. Leukocytes or WBCs are produced in the bone marrow and defend the body against infections and diseases. Each type of WBC plays a unique role to protect against infections and is present in different numbers.</p>",
                                                "id": 1760,
                                                "slug_url": "/labs/test/differential-leukocyte-count-1760",
                                                "sub_text": "This further contains"
                                            },
                                            {
                                                "name": "Red Blood Cell Count",
                                                "composition_details": [],
                                                "understand": "<p>The Red Blood Cell Count test measures the total number of red blood cells in your blood. RBCs are the most abundant cells in the blood with an average lifespan of 120 days. These cells are produced in the bone marrow and destroyed in the spleen or liver. Their primary function is to help carry oxygen from the lungs to different body parts. The normal range of RBC count can vary depending on age, gender, and the equipment and methods used for testing.</p>",
                                                "id": 1772,
                                                "slug_url": "/labs/test/red-blood-cell-count-1772"
                                            },
                                            {
                                                "name": "Hb (Hemoglobin)",
                                                "composition_details": [],
                                                "understand": "<p>An Hb (Hemoglobin) test measures the concentration of hemoglobin protein in your blood. Hemoglobin is made up of iron and globulin proteins. It is an essential part of RBCs and is critical for oxygen transfer from the lungs to all body tissues. Most blood cells, including RBCs, are produced regularly in your bone marrow. The Hb test is a fundamental part of a complete blood count (CBC) and is used to monitor blood health, diagnose various blood disorders, and assess your response to treatments if needed.</p>",
                                                "id": 1838,
                                                "slug_url": "/labs/test/hb-hemoglobin-1838"
                                            },
                                            {
                                                "name": "Platelet Count",
                                                "composition_details": [],
                                                "understand": null,
                                                "id": 1900,
                                                "slug_url": "/labs/test/platelet-count-1900"
                                            },
                                            {
                                                "name": "Total Leukocyte Count",
                                                "composition_details": [],
                                                "understand": "<p>The Total Leukocyte Count test measures the numbers of all types of leukocytes, namely neutrophil, lymphocyte, monocyte, eosinophil, and basophil, in your blood. Leukocytes or WBCs are an essential part of our immune system. These cells are produced in the bone marrow and defend the body against infections and diseases. Each type of WBC plays a unique role to protect against infections and is present in different numbers.</p>",
                                                "id": 1954,
                                                "slug_url": "/labs/test/total-leukocyte-count-1954"
                                            },
                                            {
                                                "name": "Absolute Basophil Count",
                                                "composition_details": [],
                                                "understand": "<p>An Absolute Basophil Count test measures the total number of basophils in the blood. Basophils are small, spherically-shaped cells that originate from bone marrow and make up almost 1% of the total white blood cells in the body. They attack a foreign substance and release proteins like histamine and heparin to destroy harmful substances, such as allergens, pathogens, or parasites. Histamine helps widen the blood vessels and make space for more immune cells to come to the site of infection or injury, whereas heparin acts as a blood-thinning agent and helps to avoid blood clotting at that site.</p>",
                                                "id": 1978,
                                                "slug_url": "/labs/test/absolute-basophil-count-1978"
                                            },
                                            {
                                                "name": "Absolute Monocyte Count",
                                                "composition_details": [],
                                                "understand": "<p>An Absolute Monocyte Count test measures the total number of monocytes in the blood. Monocytes are a type of WBC that originate from bone marrow and travel to different tissues via the blood. Once they are inside the tissue, these cells get converted to macrophages (a type of cell that digest harmful substances). Monocytes are the second line of defense mechanism of the human body after neutrophils. These cells are also responsible for the removal of injured or dead cells, microorganisms, and other insoluble particles from the blood.&nbsp;</p>",
                                                "id": 2141,
                                                "slug_url": "/labs/test/absolute-monocyte-count-2141"
                                            },
                                            {
                                                "name": "Absolute Eosinophil Count",
                                                "composition_details": [],
                                                "understand": "<p>An Absolute Eosinophil Count test measures the number of eosinophils in the blood and provides important information about the functioning of the immune system. Eosinophils originate from bone marrow and have a lifespan of 8-18 hours. These cells are involved in fighting certain types of infections and responding to allergic reactions in the body. Other functions of these cells include movement to the inflammation areas, trapping substances, killing cells, and bactericidal and antiparasitic activities. They also help in the treatment of immediate allergic reactions and modulation of inflammatory responses. By measuring the number of eosinophils in the blood, this test provides important information about the functioning of the immune system.</p>",
                                                "id": 2148,
                                                "slug_url": "/labs/test/absolute-eosinophil-count-2148"
                                            },
                                            {
                                                "name": "Hematocrit",
                                                "composition_details": [],
                                                "understand": "<p>The Hematocrit test measures the proportion of red blood cells (RBCs) in your blood as a percentage of the total blood volume. It is a crucial part of a complete blood count (CBC) and helps in assessing your blood health. RBCs are responsible for carrying oxygen from the lungs to different parts of the body. The hematocrit test provides valuable information about your blood's oxygen-carrying capacity.</p>\n<p>Higher-than-normal amounts of RBCs produced by the bone marrow can cause the hematocrit to increase, leading to increased blood density and slow blood flow. On the other hand, lower-than-normal hematocrit can be caused by low production of RBCs, reduced lifespan of RBCs in circulation, or excessive bleeding, leading to a reduced amount of oxygen being transported by RBCs. Monitoring your hematocrit levels is essential for diagnosing and managing various blood-related disorders.</p>",
                                                "id": 2324,
                                                "slug_url": "/labs/test/hematocrit-2324"
                                            },
                                            {
                                                "name": "Mean Corpuscular Hemoglobin",
                                                "composition_details": [],
                                                "understand": "<p>An MCH test measures the average amount of hemoglobin in a single red blood cell (RBC). Hemoglobin is an iron-containing protein in RBCs, and its major function is to transport oxygen from the lungs to all body parts. This test provides information about how much oxygen is being delivered to the body by a certain number of RBCs.</p>",
                                                "id": 2599,
                                                "slug_url": "/labs/test/mean-corpuscular-hemoglobin-2599"
                                            },
                                            {
                                                "name": "Mean Corpuscular Hemoglobin Concentration",
                                                "composition_details": [],
                                                "understand": "<p>An MCHC test measures the average amount of hemoglobin in a given volume of RBCs. MCHC is calculated by dividing the amount of hemoglobin by hematocrit (volume of blood made up of RBCs) and then multiplying it by 100.&nbsp;</p>",
                                                "id": 2600,
                                                "slug_url": "/labs/test/mean-corpuscular-hemoglobin-concentration-2600"
                                            },
                                            {
                                                "name": "Mean Platelet Volume",
                                                "composition_details": [],
                                                "understand": "<p>An MPV test measures the average size of the platelets in your blood. Platelets are disk-shaped tiny cells originating from large cells known as megakaryocytes, which are found in the bone marrow. After the platelets are formed, they are released into the blood circulation. Their average life span is 7-10 days.&nbsp;</p>\n<p>Platelets help stop bleeding whenever there is an injury or trauma to a tissue or blood vessel by adhering and accumulating at the injury site, and by releasing chemical compounds that stimulate the gathering of more platelets. After these steps, a loose platelet plug is formed at the site of injury, and this process is known as primary hemostasis. These activated platelets support the coagulation pathway that involves a series of steps including the sequential activation of clotting factors; this process is known as secondary hemostasis. After this, there is a formation of fibrin strands that form a mesh incorporated into and around the platelet plug. This mesh strengthens and stabilizes the blood clot so that it remains in place until the injury heals. After healing, other factors come into play and break the clot down so that it gets removed. In case the platelets are not sufficient in number or are not functioning properly, a stable clot might not form. These unstable clots can result in an increased risk of excessive bleeding.&nbsp;</p>",
                                                "id": 2660,
                                                "slug_url": "/labs/test/mean-platelet-volume-2660"
                                            },
                                            {
                                                "name": "PDW",
                                                "composition_details": [],
                                                "understand": "<p>The PDW test reflects variability in platelet size, and is considered a marker of platelet function and activation (clot formation in case of an injury). This marker can give you additional information about your platelets and the cause of a high or low platelet count. Larger platelets are usually younger platelets that have been recently released from the bone marrow, while smaller platelets may be older and have been in circulation for a few days. Higher PDW values reflect a larger range of platelet size, which may result from increased activation, destruction and consumption of platelets.</p>",
                                                "id": 32844,
                                                "slug_url": "/labs/test/pdw-32844"
                                            },
                                            {
                                                "name": "RDW CV",
                                                "composition_details": [],
                                                "understand": "<p>The RDW CV test which is part of red cell indices, helps identify characteristics of red blood cells. RDW (red cell distribution width) measures the variations in the sizes of red blood cells, indicating how much they differ from each other in a blood sample. RDW is expressed as RDW-CV, a coefficient of variation. A higher RDW may suggest more variation in red cell sizes, while a lower RDW indicates more uniform red cell sizes.</p>",
                                                "id": 34965,
                                                "slug_url": "/labs/test/rdw-cv-34965"
                                            }
                                        ],
                                        "understand": "<p>The CBC (Complete Blood Count) test measures the number of red blood cells (RBCs), white blood cells (WBCs), and platelets. Each of these blood cells performs essential functions&ndash;RBCs carry oxygen from your lungs to the various body parts, WBCs help fight infections and other diseases, and platelets help your blood to clot. Therefore, determining their levels can provide significant health information. A CBC test also determines the hemoglobin level, a protein in RBC that carries oxygen from the lungs to the rest of your body. Evaluating all these components together can provide important information about your overall health.</p>",
                                        "id": 1717,
                                        "slug_url": "/labs/test/cbc-complete-blood-count-1717"
                                    }
                                ],
